import { StatusBar } from 'expo-status-bar';
import { useEffect, useState } from 'react';
import { StyleSheet, Text, View, ActivityIndicator, Button, TextInput } from 'react-native';
import styles from '../styles'

function Cadastro(){

    const [ nome, setNome] = useState('');


    function cadastrar(){
        fetch('http://localhost:3001/posts', {
            method: 'POST',
            headers:{
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({
                nome : nome,
                email : email,
                senha : senha,
                telefone : telefone,
                data_nasc : data_nasc,
                sexo : sexo,
                profissao : profissao,
                cidade : cidade,
                uf : uf,
                cpf : cpf,
                foto_perfil : foto_perfil,
                is_voluntario : is_voluntario,
            })
        }).then(res => res.json())
        .then(res=>console.log(res))
        .catch(err => console.log(err))
        ;
    }    

    return (
        <>
        <View>
            <Text>TITULO</Text>
            <TextInput onChangeText={(titulo)=>setTitulo(titulo)} />
        </View>
        <View>
            <Text>CONTEUDO</Text>
            <TextInput onChangeText={(conteudo)=>setConteudo(conteudo)} />
        </View>
        <View>
            <Button onPress={()=>cadastrar()} title='Cadastrar'/>
        </View>
        </>
    );
}

export default Cadastro;
